/*MLD*/

CREATE TABLE user
(
    id                 INT NOT NULL AUTO_INCREMENT,
    email              CHAR(24),
    password           CHAR(8),
    age                CHAR(3),
    email_verification CHAR(60),
    PRIMARY KEY (id)
);

CREATE TABLE chantier
(
    numero      INT NOT NULL AUTO_INCREMENT,
    titre       CHAR(255),
    description CHAR(255),
    city        CHAR(80),
    city_cp     INT,
    chef_chantier_id INT,
    responsable_chantier_id INT,
    date_debut  DATE,
    date_fin    DATE,
    PRIMARY KEY (numero),
    FOREIGN KEY (chef_chantier_id) REFERENCES user(id),
    FOREIGN KEY (responsable_chantier_id) REFERENCES user(id)
);

